                break;
            case ('DE-COMMERZBANK-XML-SG'):
                paymSpecFieldsList = this.getFileFormatFieldsMetaData_DE_COMMERZBANK_XML_SG();
                break;
        }

        return paymSpecFieldsList;
    }

